import { configureStore } from '@reduxjs/toolkit'

import filterReducer from './slices/filterSlice'
import cartReducer from './slices/cartSlice'

export const store = configureStore({
	reducer: {
		filterer: filterReducer,
		cart: cartReducer,
	},
})
